

CREATE DATABASE IF NOT EXISTS template;
USE template;

-- table 1. role
CREATE TABLE `role` (
  `id` BIGINT NOT NULL,
  `active` TINYINT(1) DEFAULT '1',
  `description` VARCHAR(255) DEFAULT NULL,
  `role` VARCHAR(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=INNODB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


